import React, { useEffect, useRef } from 'react';
import Janus from './janus';

const MapCreatePage = () => {
    const janusRef = useRef(null);

    useEffect(() => {
        Janus.init({
            debug: "all",
            callback: function () {
                janusRef.current = new Janus({
                    server: 'http://172.30.1.40:8088/janus',
                    success: function () {
                        console.log("Connected to Janus");
                    },
                    error: function (error) {
                        console.error("Janus error", error);
                    },
                    destroyed: function () {
                        console.log("Janus instance destroyed");
                    }
                });
            }
        });

        return () => {
            if (janusRef.current) {
                janusRef.current.destroy();
            }
        };
    }, []);

    return (
        <div>
            <h1>Map Create Page</h1>
        </div>
    );
};

export default MapCreatePage;
